import React from "react";
import '../App.css';

const Login = () => {
    return <div className="login-container">
        <div className="login-box">
            <form>
                <div>
                    <input type="text" nam="username" placeholder="Enter username" />
                </div>
            </form>
        </div>
    </div>
}
export default Login;
